.text

MAIN:  
	jal MAPA
	#jal TESTE_RETA
	#jal loop
	jal START
	# Close the file 
	jal EXIT
	
EXIT:	li $v0, 10
	syscall
		
MAPA:
	addi $sp,$sp,-4
	sw $ra,0($sp)
	la $s0,map_vetor
	li $s1,0
	li $s2,0
	la $s3,X
	la $s4,Y
while_mapa:
	beq $s2,$s4,exit_map	
	beq $s1,$s3,reseta_x
	move $a0,$s1
	move $a1,$s2
	lbu $a2,0($s0)
	jal PONTO
	addi $s1,$s1,1
	addi $s0,$s0,1
	j while_mapa
reseta_x:
	li $s1,0
	addi $s2,$s2,1
	j while_mapa
exit_map:
	lw $ra,0($sp)
	addi $sp,$sp,4
	jr $ra

# $a0 = xcentro, $a1 = ycentro, $a3 = endereco_inicio_desenho	
PRINT_DESENHO:
	addi $sp,$sp,-28
	sw $ra,24($sp)
	sw $s0,20($sp)
	sw $s1,16($sp)
	sw $s2,12($sp)
	sw $s3,8($sp)
	sw $s4,4($sp)
	sw $s5,0($sp)
	
	move $s0,$a3
	subi $s1,$a0,5 				# $s1 = xc - 5
	subi $s2,$a1,5 				# $s2 = yc - 5
	addi $s3,$a0,5 				# $s3 = xc + 5
	addi $s4,$a1,5 				# $s4 = yc + 5
	move $s5,$s1
while_desenho:
	beq $s2,$s4,exit_desenho	
	beq $s1,$s3,reseta_x_desenho
	move $a0,$s1
	move $a1,$s2
	lbu $a2,0($s0)
	jal PONTO
	addi $s1,$s1,1
	addi $s0,$s0,1
	j while_desenho
reseta_x_desenho:
	move $s1,$s5 				# restaura x 
	addi $s2,$s2,1
	j while_desenho
exit_desenho:
	lw $ra,24($sp)
	lw $s0,20($sp)
	lw $s1,16($sp)
	lw $s2,12($sp)
	lw $s3,8($sp)
	lw $s4,4($sp)
	lw $s5,0($sp)
	addi $sp,$sp,28
	jr $ra

#$a0 = x, $a1 =y , $a2 = cor	
PONTO: 	la $t0, VGA_BASE
	la $t2, X
	la $t3, Y
	slt $t4,$a0,$t2 			# a0 < $t2(X)
	beqz $t4,ponto_fora_limite
	slt $t4,$a1,$t3 			# a1 < $t3(Y)
	beqz $t4,ponto_fora_limite
	mul $t1, $a1, $t2 			# $t1 = $a1(y) * 320; 
	add $t1, $t1, $a0 			# $t1 = $t1($a1(y) * 320) + $a0(x); 
	add $t0, $t0, $t1 			# $t0 = 0xFF000000 + y * 320 + x
	sb $a2, 0($t0) 				# salva $a2 (cor) no byte que $t0 corresponde.
	addi $v0,$zero,0
	jr $ra
ponto_fora_limite:
	addi $v0,$zero,4 			# x ou y esto fora do limite
	la $a0, ERRO_PONTO
	syscall
	j EXIT
	
START:  li $t0, 0xffff
	li $s0,26
	li $s1,223
	move $a0,$s0
	move $a1,$s1
	la $a3,pac_man_open_right
	jal PRINT_DESENHO
loop_ready_tecla:
	mtc0 $0, $9				# Reinicia o campo em ms
	lw $t1, 0xff100000		        # Busca se h interrupo no teclado
	andi $t1, $t1, 0x1			# Verifica o byte ready
    	addi $t0,$zero,-1               	# Decrementa o contado do clico
    	bnez $t1, check_key             	# Se houve interrupo do tecladow
    	bnez $t0, loop_ready_tecla
	#beqz $a0, move_ghost           	# Se no a interrupo do teclado move s os fantasmas
                                    		# solos a los fantasmas
    	
check_key:
    	mtc0 $0, $9
    	lw $t2, 0xff100004		        # Carrega a tecla pressionada
    	li $t1, 0x61                		# Carrega a tecla 'a' para verificar se foi a pressionada
	beq $t1, $t2, pac_move_left
    	li $t1, 0x64                		# Carrega a tecla 'd' para verificar se foi a pressionada
	beq $t1, $t2, pac_move_right
	li $t1, 0x77                		# Carrega a tecla 'w' para verificar se foi a pressionada
	beq $t1, $t2, pac_move_top
	li $t1, 0x73                		# Carrega a tecla 's' para verificar se foi a pressionada
	beq $t1, $t2, pac_move_down
    	li $t1, 0x71                    	# Carrega a tecla 'q' para sair
    	beq $t1, $t2, EXIT
    	j loop_ready_tecla
	     
pac_move_right:
 	move $a0,$s0
 	move $a1,$s1
	la $a3,quadrado_preto 			# reset quadrado
	jal PRINT_DESENHO
	addi $s0,$s0,8
	move $a0,$s0
	move $a1,$s1
	la $a3,pac_man_close_right 
	jal PRINT_DESENHO
	li $a0,200
	li $v0,32
	syscall
	move $a0,$s0
	move $a1,$s1
	la $a3,quadrado_preto 			# reset quadrado
	jal PRINT_DESENHO
	addi $s0,$s0,2
	move $a0,$s0
	move $a1,$s1
	la $a3,pac_man_open_right 
	jal PRINT_DESENHO
	j loop_ready_tecla
	
pac_move_left:
 	move $a0,$s0
 	move $a1,$s1
