	la $a3,quadrado_preto 			# reset quadrado
	jal PRINT_DESENHO
	addi $s0,$s0,-2
	move $a0,$s0
	move $a1,$s1
	la $a3,pac_man_open_left
	jal PRINT_DESENHO
	j loop_ready_tecla	 

pac_move_top:
 	move $a0,$s0
 	move $a1,$s1
